const moves= document.getElementById("moves-count")
const timeValue= document.getElementById("time")
const startButton=document.getElementById("start")
const stopButton=document.getElementById("stop")
const gameContainer= document.querySelector(".game-container")
const result= document.getElementById("result");
const controls= document.querySelector('.control-container')
let card
let interval
let firstCard= false;
let secondCard= false;
const items=[{name:"smile1",image: "data:image/png;base64,"},
{name:"smile2",image: "data:image/png;base64,"},
{name:"smile4",image: "data:image/png;base64,"},
{name:"smile5",image: "data:image/png;base64,"},
{name:"smile6",image: "data:image/png;base64,"},
{name:"smile7",image: "data:image/png;base64,"},
{name:"smile8",image: "data:image/png;base64,"},
{name:"smile9",image: "data:image/png;base64,"},
{name:"smile10",image: "data:image/png;base64,"},
{name:"smile11",image: "data:image/png;base64,"},
{name:"smile12",image: "data:image/png;base64,"},
{name:"smile13",image: "data:image/png;base64,"}]
let seconds= 0
let minutes=0
let moveCount=0
let winCount=0;


const timeGenerator =()=>{
    seconds+=1;
    if(seconds >=60){
        minutes+=1;
        seconds=0
    }

let secondValue = seconds< 10 ? `0${seconds}`:seconds;
let minuteValue = minutes< 10 ? `0${minutes}`:minutes;
timeValue.innerHTML=`<span>Time:</span>${minuteValue}:${secondValue}`;
};
const moveCounter=()=>{
    moveCount+=1;
    moves.innerHTML =`<span>Moves:</span> ${moveCount}`
};
const generateRandom = (size = 4) => {
    let tempArray = [...items];
    let cardValues = [];
    size = (size * size) / 2;
    for (let i = 0; i < size; i++) {
      const randomIndex = Math.floor(Math.random() * tempArray.length);
      cardValues.push(tempArray[randomIndex]);
      tempArray.splice(randomIndex, 1);
    }
    return cardValues; 
  };
const matrixGenerator =( cardValues, size=4)=>{
    gameContainer.innerHTML="";
    cardValues =[...cardValues,...cardValues];
    cardValues.sort(()=> Math.random()-0.5);
    for(let i=0; i<size*size; i++){
        gameContainer.innerHTML+=`<div class= "card-container" data-card-value="${cardValues[i].name}"><div class= "card-before"><img src="data:image/png;base64,"></div>
         <div class="card-after"><img src="${cardValues[i].image}"></div></div>`
        ;
    }
    gameContainer.style.gridTemplateColumns = `repeat(${size}, auto)`;
    let cards= document.querySelectorAll(".card-container")
    cards.forEach((card)=>{
        card.addEventListener("click",()=>{
            if(!card.classList.contains("matched")){
                card.classList.add("flipped");
                if(!firstCard){
                   firstCard=card;
                    firstCardValue=card.getAttribute("data-card-value")
                }
                else{
                    moveCounter();
                     secondCard=card
                    let secondCardValue=card.getAttribute("data-card-value")
                    if(firstCardValue==secondCardValue){
                        firstCard.classList.add("matched");
                        secondCard.classList.add("matched");
                        
                        firstCard=false;
                        winCount+=1;
                        if(winCount == Math.floor(cardValues.length/2)){
                            result.innerHTML=`<h2>You Won!! </h2><img src="data:image/png;base64,"> <h4>Moves:${moveCount}</h4>`;
                            stopGame();
                        }
                    } else{
                        let[tempFirst,tempSecond]=[firstCard,secondCard];
                        firstCard=false;
                        secondCard=false;
                        let delay = setTimeout(()=>{
                            tempFirst.classList.remove("flipped");
                            tempSecond.classList.remove("flipped");
                        },900);
                    }
                }
            }
         
        })
    }
)
};
const initializer=()=>{
    result.innerText="";
    winCount=0
    let cardValues = generateRandom();
    console.log(cardValues)
    matrixGenerator(cardValues);

};
startButton.addEventListener("click",()=>{
    moveCount=0;
    time=0;
    controls.classList.add("hide");
    startButton.classList.add("hide");
    stopButton.classList.remove("hide");
    interval = setInterval(timeGenerator,1000);
    moves.innerHTML=`<span>Moves:</span> ${moveCount}`;
    initializer();
})


stopButton.addEventListener("click",(stopGame=()=>{
    controls.classList.remove("hide")
    stopButton.classList.add("hide")
    startButton.classList.remove("hide");
    clearInterval(interval);
}))


